CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Advance_PayableAmount` (IN `EmpId` INT)   BEGIN
DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
        BEGIN
            ROLLBACK;
        END;
START TRANSACTION;
-- Calculate the number of days in the previous month (August)
SET @DaysInCurrentMonth = DAY(LAST_DAY(CURRENT_DATE));

    -- 6 days emp==========================
    SET @SundayOff = (SELECT COUNT(date_field) FROM (
        SELECT MAKEDATE(YEAR(NOW()), 1) + INTERVAL (MONTH(NOW()) - 1) MONTH + INTERVAL daynum DAY date_field
        FROM (
            SELECT t * 10 + u daynum
            FROM (
                SELECT 0 t UNION SELECT 1 UNION SELECT 2 UNION SELECT 3
            ) A,
            (
                SELECT 0 u UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4
                UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9
            ) B
            ORDER BY daynum
        ) AA
    ) AAA
    WHERE MONTH(date_field) = MONTH(NOW()) AND DAYOFWEEK(date_field) != 1
    ORDER BY 1 ASC);
    
    -- 5 days emp==========================
    SET @SatSunOff = (SELECT COUNT(date_field) FROM (
        SELECT MAKEDATE(YEAR(NOW()), 1) + INTERVAL (MONTH(NOW()) - 1) MONTH + INTERVAL daynum DAY date_field
        FROM (
            SELECT t * 10 + u daynum
            FROM (
                SELECT 0 t UNION SELECT 1 UNION SELECT 2 UNION SELECT 3
            ) A,
            (
                SELECT 0 u UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4
                UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9
            ) B
            ORDER BY daynum
        ) AA
    ) AAA
    WHERE MONTH(date_field) = MONTH(NOW()) AND DAYOFWEEK(date_field) NOT IN (1, 7)
    ORDER BY 1 ASC);
    
    SELECT a.Net_Salary as PayableAmount FROM
    (
    SELECT
        up.RecId AS EMPID,
        up.salary,
        FLOOR(DeductedDaysBecauseOfLateArrival) AS DeductionDays,
        NoOfLates AS TotalLate,
        (SystemWorkingDays - AttendedDays) AS Absent,
        (
            (FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival))) + (FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays)))) AS Deduction,
            up.Advance,
        FLOOR(up.salary - FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival)) - up.Advance - FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays))
             ) AS Net_Salary
    FROM (
        SELECT
            @SatSunOff AS SatSunOff,
            @SundayOff AS SunOff,
            CASE WHEN up.workingDays = 5 THEN @SatSunOff ELSE @SundayOff END AS SystemWorkingDays,
            up.Employee_Id AS EMPID,
            COUNT(a.check_in_date) AS AttendedDays,
            SUM(CASE 
                WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                THEN 0 
                ELSE 
                    CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END
            END) / 3 AS DeductedDaysBecauseOfLateArrival,
            SUM(CASE 
                WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                THEN 0 
                ELSE 
                    CASE WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) > TIME(s.grace_time) THEN 1 ELSE 0 END
            END) AS _NoOfLates,
            FLOOR((SUM(CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END))) NoOfLates
        FROM
            attendance a
        JOIN user_profile up ON up.Employee_Id = a.Employee_Id 
        JOIN shift s ON s.RecId = up.shift_id
        JOIN designation d ON d.RecId = up.Designation_Id
        JOIN pay_scale pp ON pp.RecId = up.payscale_id
        WHERE a.isactive = 1 AND a.Employee_Id = EmpId
        GROUP BY up.Employee_Id
    ) AS a
    JOIN user_profile up ON up.Employee_Id = a.EMPID 
    JOIN shift s ON s.RecId = up.shift_id
    JOIN designation d ON d.RecId = up.Designation_Id
    JOIN pay_scale pp ON pp.RecId = up.payscale_id
     ) as A;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_Cursor_PayrollGenerator` ()   BEGIN

DECLARE done INT DEFAULT 0;

-- Declare variables for cursor
DECLARE v_EMPID INT;
DECLARE v_DesignationId INT;
DECLARE v_Shift INT;
DECLARE v_PayId INT;
DECLARE v_TimeIn TIME;
DECLARE v_TimeOut TIME;
DECLARE v_salary DECIMAL(10,2);
DECLARE v_DeductionDays INT;
DECLARE v_TotalLate INT;
DECLARE v_Absent INT;
DECLARE v_Deduction DECIMAL(10,2);
DECLARE v_MDeduction DECIMAL(10,2);
DECLARE v_Advance DECIMAL(10,2);
DECLARE v_MAdvance DECIMAL(10,2);
DECLARE v_Net_Salary DECIMAL(10,2);
DECLARE v_MSalary DECIMAL(10,2);

-- Declare cursor
DECLARE empCursor CURSOR FOR
    SELECT 
    up.RecId AS EMPID,
    d.RecId,
    s.RecId AS Shift, 
    pp.RecId, 
    TIME(s.time_in) AS TimeIn, 
    TIME(s.time_out) AS TimeOut, 
    up.salary,
           FLOOR(DeductedDaysBecauseOfLateArrival) AS DeductionDays, NoOfLates AS TotalLate,
           (SystemWorkingDays - AttendedDays) AS Absent,  
           ((FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival))) + 
            (FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays)))) AS Deduction,
           ((FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival))) + 
            (FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays)))) AS MDeduction,
           up.Advance,
           up.Advance,
           FLOOR(up.salary - FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival)) - 
                 up.Advance - FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays))) AS Net_Salary,
           FLOOR(up.salary - FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival)) - 
                 up.Advance - FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays))) AS MSalary
    FROM (
        SELECT @SatSunOff AS SatSunOff, @SundayOff AS SunOff,
               CASE WHEN up.workingDays = 5 THEN @SatSunOff ELSE @SundayOff END AS SystemWorkingDays,
               up.Employee_Id AS EMPID, COUNT(a.check_in_date) AS AttendedDays,
               SUM(CASE 
                   WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                   THEN 0 
                   ELSE 
                       CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND 
                                 TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END
               END) / 3 AS DeductedDaysBecauseOfLateArrival,
               SUM(CASE 
                   WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                   THEN 0 
                   ELSE 
                       CASE WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) > TIME(s.grace_time) 
                                 THEN 1 ELSE '0' END
               END) AS _NoOfLates,
               FLOOR((SUM(CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND 
                                  TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END))) NoOfLates
        FROM attendance a
        JOIN user_profile up ON up.Employee_Id = a.Employee_Id 
        JOIN shift s ON s.RecId = up.shift_id
        JOIN designation d ON d.RecId = up.Designation_Id
        JOIN pay_scale pp ON pp.RecId = up.payscale_id
        WHERE a.isactive = 1
        GROUP BY up.Employee_Id
    ) AS a
    JOIN user_profile up ON up.Employee_Id = a.EMPID 
    JOIN shift s ON s.RecId = up.shift_id
    JOIN designation d ON d.RecId = up.Designation_Id
    JOIN pay_scale pp ON pp.RecId = up.payscale_id;

-- Declare continue handler for cursor
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
    END;
START TRANSACTION;
        
-- Calculate the number of days in the current month
-- Calculate the number of days in the previous month (August)
SET @DaysInCurrentMonth = DAY(LAST_DAY(CURRENT_DATE));
	-- Get Holidays for current Month
    SET @HolidayCount = (SELECT COUNT(*) FROM holidays h WHERE h.isactive=1 AND MONTH(h.Holiday_Date) = (MONTH(NOW()) - 1) AND YEAR(h.Holiday_Date) = YEAR(NOW()));

     -- 6 days emp==========================
    SET @SundayOff = (SELECT COUNT(date_field) FROM (
        SELECT MAKEDATE(YEAR(NOW()), 1) + INTERVAL (MONTH(NOW()) - 2) MONTH + INTERVAL daynum DAY date_field
        FROM (
            SELECT t * 10 + u daynum
            FROM (
                SELECT 0 t UNION SELECT 1 UNION SELECT 2 UNION SELECT 3
            ) A,
            (
                SELECT 0 u UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4
                UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9
            ) B
            ORDER BY daynum
        ) AA
    ) AAA
    WHERE MONTH(date_field) = (MONTH(NOW()) - 1 ) AND DAYOFWEEK(date_field) != 1
    ORDER BY 1 ASC);
    
    -- 5 days emp==========================
    SET @SatSunOff = (SELECT COUNT(date_field) FROM (
        SELECT MAKEDATE(YEAR(NOW()), 1) + INTERVAL (MONTH(NOW()) - 2) MONTH + INTERVAL daynum DAY date_field
        FROM (
            SELECT t * 10 + u daynum
            FROM (
                SELECT 0 t UNION SELECT 1 UNION SELECT 2 UNION SELECT 3
            ) A,
            (
                SELECT 0 u UNION SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4
                UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9
            ) B
            ORDER BY daynum
        ) AA
    ) AAA
    WHERE MONTH(date_field) = (MONTH(NOW()) - 1 ) AND DAYOFWEEK(date_field) NOT IN (1, 7)
    ORDER BY 1 ASC);
    
    -- Reducting Holidays for System Working Days 
    SET @SatSunOff = (@SatSunOff - @HolidayCount );
    SET @SundayOff = (@SundayOff - @HolidayCount );
    
    -- Open the cursor
    OPEN empCursor;    
    -- Loop through cursor results
    employee_loop: LOOP
        FETCH empCursor INTO 
          v_EMPID, 
          v_DesignationId, 
          v_Shift, v_PayId, 
          v_TimeIn, 
          v_TimeOut, 
          v_salary, 
          v_DeductionDays, 
          v_TotalLate, 
          v_Absent, 
          v_Deduction, 
          v_MDeduction,
          v_Advance,
          v_MAdvance, 
          v_MSalary, 
          v_Net_Salary;
        
        IF done = 1 THEN
            LEAVE employee_loop;
        END IF;

         SET @PayrollExists = (SELECT COUNT(*) FROM payroll WHERE UserP_Id = v_EMPID AND MONTH(created_on) = MONTH(NOW()));

         IF @PayrollExists = 0 THEN     
         
        -- Insert data into payroll table
            UserP_Id, 
            Designation_Id, 
            Shift_Id, 
            Pay_Id, 
            time_in, 
            time_out,
            PayRoll_Type, 
            salary, 
            deducted_days, 
            late, 
            absent, 
            Deduction, 
            M_Deducted, 
            Advance,
            M_Advance,
            M_Salary, 
            Total_Pay, 
            created_by, 
            updated_by
            )
        VALUES (
            v_EMPID, 
            v_DesignationId, 
            v_Shift, 
            v_PayId, 
            v_TimeIn, 
            v_TimeOut,
            1,
            v_salary, 
            v_DeductionDays, 
            v_TotalLate, 
            v_Absent, 
            v_Deduction, 
            v_MDeduction, 
            v_Advance,
            v_MAdvance,
            v_MSalary, 
            v_Net_Salary, 
            1, 
            1
            );

         
            UPDATE user_profile up SET up.Advance = (up.Advance - v_MAdvance) WHERE up.Employee_Id = v_EMPID and up.isactive = 1;

            END IF;
    END LOOP;
    
    -- Close the cursor
    CLOSE empCursor;
-- END IF;
 
-- Show Data
SELECT
    pr.RecId,
    CONCAT(up.firstname, ' ', up.lastname) AS Employee_Name,
    d.designation_name,
    s.shift_name,
    ps.pay_name,
    TIME(s.time_in) time_in,
    TIME(s.time_out) time_out,
    pt.Name As payroll_type,
    pr.salary,
    pr.deducted_days,
    pr.late,
    pr.absent,
    pr.Deduction,
    pr.M_Deducted,
    pr.Advance,
    pr.M_Advance,
    pr.M_Salary,
    pr.Total_Pay,
    pr.updated_on
FROM payroll pr 
JOIN user_profile up ON up.RecId = pr.UserP_Id 
JOIN designation d ON d.RecId = pr.Designation_Id 
JOIN shift s ON s.RecId = pr.Shift_Id 
JOIN pay_scale ps ON ps.RecId = pr.Pay_Id 
JOIN payroll_type pt ON pt.RecId = pr.PayRoll_Type 
WHERE MONTH(pr.created_on) = MONTH(NOW()) 
AND pr.isactive = 1
AND d.isactive = 1
AND s.isactive = 1
AND pt.isactive = 1;

COMMIT;
END$$

