            (FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival))) + (FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays)))) AS Deduction,
        (
            (FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival))) + (FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays)))) AS MDeduction,
        up.Advance,
        up.Advance,
        FLOOR(up.salary - FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival)) - up.Advance - FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays))
             ) AS Net_Salary,
        FLOOR(up.salary - FLOOR((up.salary / @DaysInCurrentMonth) * FLOOR(DeductedDaysBecauseOfLateArrival)) - up.Advance - FLOOR((up.salary / @DaysInCurrentMonth) * (SystemWorkingDays - AttendedDays))
             ) AS MSalary,
        UserRecID,
        UserRecID
    FROM (
        SELECT
            @SatSunOff AS SatSunOff,
            @SundayOff AS SunOff,
            CASE WHEN up.workingDays = 5 THEN @SatSunOff ELSE @SundayOff END AS SystemWorkingDays,
            up.Employee_Id AS EMPID,
            (COUNT(a.check_in_date) + @HolidayCount) AS AttendedDays,
            SUM(CASE 
                WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                THEN 0 
                ELSE 
                    CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END
            END) / 3 AS DeductedDaysBecauseOfLateArrival,
            SUM(CASE 
                WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) <= 0 
                THEN 0 
                ELSE 
                    CASE WHEN SEC_TO_TIME(TIME_TO_SEC(TIME(a.check_in) - TIME(s.time_in))) > TIME(s.grace_time) THEN 1 ELSE 0 END
            END) AS _NoOfLates,
            FLOOR((SUM(CASE WHEN TIME(a.check_in) > ADDTIME(TIME(s.time_in), TIME(s.grace_time)) AND TIME(a.check_in) < ADDTIME(TIME(s.time_in), '04:00:00') THEN '1' ELSE '0' END))) NoOfLates
        FROM
            attendance a
        JOIN user_profile up ON up.Employee_Id = a.Employee_Id 
        JOIN shift s ON s.RecId = up.shift_id
        JOIN designation d ON d.RecId = up.Designation_Id
        JOIN pay_scale pp ON pp.RecId = up.payscale_id
        WHERE a.isactive = 1 AND a.Employee_Id = EmpId  AND MONTH(a.check_in_date) =  MONTH(CURRENT_DATE) 
        AND YEAR(a.check_in_date) =  YEAR(CURRENT_DATE)
        GROUP BY up.Employee_Id
    ) AS a
    JOIN user_profile up ON up.Employee_Id = a.EMPID 
    JOIN shift s ON s.RecId = up.shift_id
    JOIN designation d ON d.RecId = up.Designation_Id
    JOIN pay_scale pp ON pp.RecId = up.payscale_id;
END IF;

-- Show Data
SELECT
    pr.RecId,
    CONCAT(up.firstname, ' ', up.lastname) AS Employee_Name,
    d.designation_name,
    s.shift_name,
    ps.pay_name,
    TIME(s.time_in) time_in,
    TIME(s.time_out) time_out,
    pt.Name As payroll_type,
    pr.salary,
    pr.deducted_days,
    pr.late,
    pr.absent,
    pr.Deduction,
    pr.M_Deducted,
    pr.Advance,
    pr.M_Advance,
    pr.M_Salary,
    pr.Total_Pay,
    pr.updated_on
FROM payroll pr 
JOIN user_profile up ON up.RecId = pr.UserP_Id 
JOIN designation d ON d.RecId = pr.Designation_Id 
JOIN shift s ON s.RecId = pr.Shift_Id 
JOIN pay_scale ps ON ps.RecId = pr.Pay_Id 
JOIN payroll_type pt ON pt.RecId = pr.PayRoll_Type
WHERE MONTH(pr.created_on) = MONTH(NOW()) 
AND pr.isactive = 1
AND d.isactive = 1
AND s.isactive = 1
AND pt.isactive = 1;
COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `StrProc_ChangeAdvanceInfo` (IN `adv_Id` INT, IN `UpId` INT, IN `Amount` DOUBLE, IN `AmountDate` DATETIME)   BEGIN 
DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
        BEGIN
            ROLLBACK;
        END;
START TRANSACTION;
UPDATE advance as ad SET  ad.Up_Id = UpId, ad.Amount = Amount, ad.AmoutDate = AmountDate, ad.updated_by = 1 , ad.updated_on = CURRENT_TIMESTAMP WHERE ad.RecId = adv_Id AND ad.isactive = 1;
COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `StrProc_ChangeAttendanceInfo` (IN `EmpId` INT, IN `check_in` VARCHAR(50), IN `check_out` VARCHAR(50))   BEGIN 
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
    END;
    
    START TRANSACTION;
    
    -- Declare variables to store previous datetime values
   SET @checkinold = (SELECT date(a.check_in) FROM attendance a WHERE a.RecId = EmpId);
   SET @checkoutold = (SELECT date(a.check_out) FROM attendance a WHERE a.RecId = EmpId);
    -- Convert the input time strings to TIME format
    SET @newCheckInTime = STR_TO_DATE(check_in, '%H:%i:%s');
    SET @newCheckOutTime = STR_TO_DATE(check_out, '%H:%i:%s');
    
    -- Update the check_in and check_out columns by concatenating with the existing date
    UPDATE attendance AS a 
    SET a.check_in = CONCAT(@checkinold, ' ', @newCheckInTime),
        a.check_out = CONCAT(@checkoutold, ' ', @newCheckOutTime),
        a.updated_by = 1,
        a.updated_on = CURRENT_TIMESTAMP
    WHERE a.RecId = EmpId AND a.isactive = 1;
    
    COMMIT;
END$$

